import Tasks from './components/Tasks';
import { useState } from "react"
import '../src/index.css';

function App() {
  const [vars, tastStat] = useState([
    {text:'happy',id:1},
    {text:'welcome',id:2},
    {text:'playing',id:3},
    {text:'just go',id:4}
    ])
  return (
    <div className='container'>
      <Header />
      <Tasks vars={vars}/>
    </div>
  );
}

export default App;
